import React from "react";
import { useSelector } from "react-redux";
import SwiperComponent from "../../(utils)/SwiperComponent";
import { useParams } from "react-router-dom";

const Episodes = () => {
  const { id } = useParams();
  const seasonsDetailed = useSelector((state) => state.series.tvSeason.data);
  return (
    <div>
      {/* {seasonsDetailed.episodes?.map((item, index) => {
        return <div key={index}>Episode {item.episode_number}</div>;
      })} */}
      <SwiperComponent
        data={seasonsDetailed.episodes}
        id={id}
        episodes={true}
      />
    </div>
  );
};

export default Episodes;
